// >>> mean_absolute_deviation([1.0, 2.0, 3.0, 4.0])
// 1.0
function mean_absolute_deviation(numbers){
  let mean = numbers.reduce((acc, curr) => acc + curr, 0) / numbers.length;
  let abs_dev = numbers.map(curr => Math.abs(curr - mean));
  return Math.round(Math.sqrt(abs_dev.reduce((acc, curr) => acc + curr, 0) / numbers.length));
