// >>> sort_even([1, 2, 3])
// [1, 2, 3]
// >>> sort_even([5, 6, 3, 4])
// [3, 6, 5, 4]
function sort_even(l){
    let even_indices = [];
    let odd_indices = [];
    for (let i = 0; i < l.length; i++) {
        if (l[i] % 2 === 0) {
            even_indices.push(i);
        } else {
            odd_indices.push(i);
        }
    }
    let l' = l.slice();
    l'[even_indices].sort();
    l'[odd_indices].sort();
    return l'
}
//prime_fib returns n-th number that is a Fibonacci number and it's also prime.
// >>> prime_fib(1)
// 2
// >>> prime_fib(2)
// 3
// >>> prime_fib(3)
// 5
// >>> prime_fib(4)
// 13
// >>> prime_fib(5)
// 89
function prime_fib(n){
    if(n < 2){
        return n;
    }
    let a = 2;
    let b = 3;
    let c = 5;
    while(c < n){
        let temp = a;
        a = b;
        b = c;
        c = temp + c;
        if(c % 2 === 0){
            return c;
        }
    }
    return c;
}
