//Return 2^n modulo p (be aware of numerics).
// >>> modp(3, 5)
// 3
// >>> modp(1101, 101)
// 2
// >>> modp(0, 101)
// 1
// >>> modp(3, 11)
// 8
// >>> modp(100, 101)
// 1
function modp(n, p){
    let res = 1;
    while(n > 0){
        if(n % 2 == 1){
            res = (res * p) % p;
        }
        n = n / 2;
        p = p * p;
    }
    return res;
}
