//brackets is a string of "<" and ">".
// return true if every opening bracket has a corresponding closing bracket.
// >>> correct_bracketing("<")
// false
// >>> correct_bracketing("<>")
// true
// >>> correct_bracketing("<<><>>")
// true
// >>> correct_bracketing("><<>")
// false
function correct_bracketing(brackets){
    let stack = [];
    let open = [];
    let close = [];
    for(let i = 0; i < brackets.length; i++){
        if(brackets[i] === "<"){
            open.push(i);
        }
        else if(brackets[i] === ">"){
            let index = open.indexOf(i);
            if(index !== -1){
                close.push(index);
            }
            else{
                close.push(i);
            }
        }
        else{
            if(open.length > 0){
                let index = open.indexOf(i);
                if(index !== -1){
                    open.splice(index, 1);
                }
            }
            else{
                close.push(i);
            }
        }
    }
    if(close.length === 0){
        return true;
    }
    else{
        return false;
    }
}
