//Return sorted unique common elements for two arrays.
// >>> common([1, 4, 3, 34, 653, 2, 5], [5, 7, 1, 5, 9, 653, 121])
// [1, 5, 653]
// >>> common([5, 3, 2, 8], [3, 2])
// [2, 3]
function common(l1, l2){
  let common = [];
  let l1Len = l1.length;
  let l2Len = l2.length;
  let l1Set = new Set(l1);
  let l2Set = new Set(l2);
  for (let i = 0; i < l1Len; i++) {
    if (l1Set.has(l1[i])) {
      common.push(l1[i]);
    }
  }
  for (let i = 0; i < l2Len; i++) {
    if (l2Set.has(l2[i])) {
      common.push(l2[i]);
    }
  }
  return common;
}
//Return the largest prime factor of n. Assume n > 1 and is not a prime.
// >>> largest_prime_factor(13195)
// 29
// >>> largest_prime_factor(2048)
// 2
function largest_prime_factor(n){
  let max = 0;
  let current_prime = 2;
  while(current_prime <= n){
    if(n % current_prime == 0){
      max = current_prime;
      break;
    }
    current_prime++;
  }
  return max;
}
