//brackets is a string of "(" and ")".
// return true if every opening bracket has a corresponding closing bracket.
// >>> correct_bracketing("(")
// false
// >>> correct_bracketing("()")
// true
// >>> correct_bracketing("(()())")
// true
// >>> correct_bracketing(")(()")
// false
function correct_bracketing(brackets){
  let stack = [];
  let open = [];
  let close = [];
  for(let i = 0; i < brackets.length; i++){
    if(brackets[i] === "("){
      open.push(i);
    } else if(brackets[i] === ")"){
      let index = open.indexOf(i);
      if(index === -1){
        return false;
      }
      close.push(i);
      open.splice(index, 1);
    }
  }
  if(close.length === 0){
    return true;
  } else {
    return false;
  }
}
//xs represent coefficients of a polynomial.
// xs[0] + xs[1] * x + xs[2] * x^2 + ....
// Return derivative of this polynomial in the same form.
// >>> derivative([3, 1, 2, 4, 5])
// [1, 4, 12, 20]
// >>> derivative([1, 2, 3])
// [2, 6]
function derivative(xs){
    let result = [];
    for(let i = 0; i < xs.length; i++){
        let curr = xs[i];
        let prev = xs[i - 1];
        let next = xs[i + 1];
        result.push(curr - prev + next);
    }
    return result;
}
