// "12"
function circular_shift(x, shift){
    let result = "";
    let temp = x;
    while(shift > Math.floor(Math.log10(x))){
        result += temp % 10;
        temp = Math.floor(temp / 10);
        shift--;
    }
    while(shift > 0){
        result += temp % 10;
        temp = Math.floor(temp / 10);
        shift--;
    }
    return result;
}
