// >>> encrypt("gf")
// "kj"
// >>> encrypt("et")
// "ix"
function encrypt(s){
    let alphabet = "abcdefghijklmnopqrstuvwxyz";
    let alphabetRotated = alphabet.split('').map(letter => letter.toUpperCase() + letter.toLowerCase());
    let encrypted = "";
    for (let i = 0; i < s.length; i++) {
