// >>> skjkasdkd([0, 81, 12, 3, 1, 21])
// 3
// >>> skjkasdkd([0, 8, 1, 2, 1, 7])
// 7
function skjkasdkd(lst){
    let max = 0;
    let sum = 0;
    for(let i = 0; i < lst.length; i++){
        if(lst[i] % 2 === 0){
            continue;
        }
        let num = lst[i];
        let div = Math.floor(num / 2);
        while(div >= 1){
            if(div % 2 === 0){
                div = div / 2;
