// * grid[i][j] -> 0 | 1
// * 1 <= capacity <= 10
function max_fill(grid, capacity){
  let buckets = []
  let max_fill = 0
  for(let i = 0; i < grid.length; i++){
    for(let j = 0; j < grid[i].length; j++){
      if(grid[i][j] == 1){
        buckets.push([i, j])
      }
    }
  }
  for(let i = 0; i < buckets.length; i++){
    let bucket = buckets[i]
    let bucket_capacity = capacity
    let bucket_size = bucket[1]
