//Given an integer. return an array that has the number of even and odd digits respectively.
// Example:
// >>> even_odd_count(-12)
// [1, 1]
// >>> even_odd_count(123)
// [1, 2]
function even_odd_count(num){
    let even_count = 0;
    let odd_count = 0;
    while(num > 0){
        if(num % 2 === 0){
            even_count++;
        }
        else{
            odd_count++;
        }
        num = Math.floor(num / 10);
    }
    return [even_count, odd_count];
}
