// "xix"
// >>> int_to_mini_roman(152)
// "clii"
// >>> int_to_mini_roman(426)
// "cdxxvi"
function int_to_mini_roman(number){
  let roman = "";
  let roman_numbers = [
    "M", "CM", "D", "CD", "C", "XC", "L", "XL", "X", "IX", "V", "IV", "I"
  ];
  let roman_numbers_reverse = roman_numbers.reverse();
  for (let i = 0; i < roman_numbers.length; i++) {
    if (number >= roman_numbers[i]) {
      roman += roman_numbers_reverse[i];
      number -= roman_numbers[i];
    }
  }
  return roman;
}
