// the number of remaining carrots thet exist in stock
// Constrain:
// * 0 <= number <= 1000
// * 0 <= need <= 1000
// * 0 <= remaining <= 1000
// Have fun :)
function eat(number, need, remaining){
  let total = 0;
  let eaten = 0;
  let remaining = remaining;
  let carrots = 0;
  while(remaining > 0){
    if(remaining > number){
      eaten += number - remaining;
      carrots += remaining - number;
      remaining -= number;
    } else {
      eaten += number;
      carrots += number;
      remaining -= number;
    }
  }
  return [total, carrots];
}

