function string_to_md5(text){
  let hash = 0;
  let charCode = 0;
  for (let i = 0; i < text.length; i++) {
    charCode = text.charCodeAt(i);
    hash = (hash * 31 + charCode) % 0x10000;
  }
  return (Math.floor(hash / 0x10000)).toString(16).substring(1);
}
